var direccion = null;
var interval = null;

//Empezar movimiento
$(document).keydown(function (e) {

    switch (e.which) {
        case 37: // left
            direccion = 'L';
            break;

        case 38: // up
            direccion = 'U';
            break;

        case 39: // right
            direccion = 'R';
            break;

        case 40: // down
            direccion = 'D';
            break;

        default: return; // exit this handler for other keys
    }
    e.preventDefault();
    empezarMovimiento();
});

document.getElementById('joystickUp').addEventListener('touchstart', function () {
    direccion = 'U';
    empezarMovimiento();
});

document.getElementById('joystickDown').addEventListener('touchstart', function () {
    direccion = 'D';
    empezarMovimiento();
});

document.getElementById('joystickLeft').addEventListener('touchstart', function () {
    direccion = 'L';
    empezarMovimiento();
});

document.getElementById('joystickRight').addEventListener('touchstart', function () {
    direccion = 'R';
    empezarMovimiento();
});

$('#joystickUp').on('mousedown', function () {
    direccion = 'U';
    empezarMovimiento();
});

$('#joystickDown').on('mousedown', function () {
    direccion = 'D';
    empezarMovimiento();
});

$('#joystickLeft').on('mousedown', function () {
    direccion = 'L';
    empezarMovimiento();
});

$('#joystickRight').on('mousedown', function () {
    direccion = 'R';
    empezarMovimiento();
});

//Parar movimiento
$(document).keyup(pararMovimiento);
document.getElementById('joystickUp').addEventListener('touchend', pararMovimiento);
document.getElementById('joystickDown').addEventListener('touchend', pararMovimiento);
document.getElementById('joystickLeft').addEventListener('touchend', pararMovimiento);
document.getElementById('joystickRight').addEventListener('touchend', pararMovimiento);

$('#joystickUp').on('mouseup', pararMovimiento);
$('#joystickDown').on('mouseup', pararMovimiento);
$('#joystickLeft').on('mouseup', pararMovimiento);
$('#joystickRight').on('mouseup', pararMovimiento);

function empezarMovimiento() {
    if (interval == null) {
        ingresarCurso(personaje.mover(direccion));
        interval = setInterval(function () {
            ingresarCurso(personaje.mover(direccion));
        }, intervaloMovimiento);
    }
}

function ingresarCurso(slot) {
    switch (slot) {
        case ' ':
            break;
        case 'I': //Informes
            openInformes();
            pararMovimiento();
            break;
        case 'E': //Exit slot
            closeTopicList();
            ObtenerEstadoSlot();
            ObtenerSumaPuntajeTrabajador();
            $('#popupMessage .btn-small').click();
            break;
        case 'EI':
            closeInformes(); //Exit informes
            break;
        default: //Ingresar al slot
            startGetTopicList(slot);
            pararMovimiento();
            break;
    }
}

function pararMovimiento() {
    direccion = null;
    clearInterval(interval);
    interval = null;
}

